let images = [img1, img2, img3, img4, img5, img6, img7, img8];
let N;
let previousState = [];
let state = [];
let gameState; // on, waiting, paused, finished

// hidden, visible or solved
let evolve = function (nCouple, AorB) {
  previousState = JSON.parse(JSON.stringify(state)); // Save the current state to keep track of the changes. Deep copy
  //   console.log("previous", JSON.stringify(state));
  //   console.log("current", JSON.stringify(previousState));
  // If the user clicked a square that was already solved
  // or one that was visible
  // there wont be any change in the state of the system
  if (state[nCouple][AorB] === "solved" || state[nCouple][AorB] === "visible") {
    return "noChange"; // There was not any change
  } else {
    // Determine if this is the first or the second click
    let visibleImgs = state.filter(
      (c) => c.A === "visible" || c.B === "visible"
    );
    let numVisibleImgs = visibleImgs.length;
    // console.log("Visible: ", numVisibleImgs);
    if (numVisibleImgs == 0) {
      // If this is the first click
      state[nCouple][AorB] = "visible"; // make this image visible temporarilly
      return "firstClick"; // 1 means that it is the first click
    } else {
      let pair = AorB === "A" ? "B" : "A";
      //   console.log("Pair", pair);
      if (state[nCouple][pair] === "visible") {
        // If the user found the solution
        // console.log("Resuelto");
        state[nCouple]["A"] = "solved";
        state[nCouple]["B"] = "solved";
        return "solved"; //2 means that
      } //if the user made a mistake
      else {
        visibleImgs[0]["A"] = "hidden";
        visibleImgs[0]["B"] = "hidden";
        return "notSolved";
      }
    }
  }
};
let gameFinished = function () {
  console.log(state.length);
  //   let isFinished = true;
  for (let nCouple = 0; nCouple < state.length; nCouple++) {
    let c = state[nCouple];
    if (c.A === "solved" && c.B === "solved") {
      console.log("resuelto", c);
    } else {
      return false;
    }
  }
  return true;
};
let clickedImg = function () {
  console.log(gameState);
  if (gameState != "on") return 0;
  //   console.log(this);
  let AorB = this.id[this.id.length - 1];
  let nCouple = this.id[this.id.length - 2];

  let result = evolve(nCouple, AorB);
  console.log(`Couple: ${nCouple} ${AorB} -> ` + result);

  if (result === "solved") {
    // console.log(gameFinished());
    if (gameFinished()) {
      //   console.log("Finished");
      gameState = "finished";
      showFinalMenu();
    }
    redraw();
  } else {
    if (!(result === "noChange")) {
      showImage(nCouple, AorB);
      gameState = "waiting";
      setTimeout(
        function () {
          hideImage(nCouple, AorB);
          redraw();
          gameState = "on";
        },
        result === "notSolved" ? 1000 : 0
      );
    }
  }
};
let showImage = function (nCouple, AorB) {
  couples[nCouple][AorB].imgDOM.src = couples[nCouple].img;
};
let hideImage = function (nCouple, AorB) {
  couples[nCouple][AorB].imgDOM.src = defaultImg;
};
function shuffle(array) {
  var currentIndex = array.length,
    temporaryValue,
    randomIndex;

  // While there remain elements to shuffle...
  while (0 !== currentIndex) {
    // Pick a remaining element...
    randomIndex = Math.floor(Math.random() * currentIndex);
    currentIndex -= 1;

    // And swap it with the current element.
    temporaryValue = array[currentIndex];
    array[currentIndex] = array[randomIndex];
    array[randomIndex] = temporaryValue;
  }

  return array;
}
const container = document.getElementById("gameContainer");
const mainMenu = document.getElementById("mainMenu");
const finalMenu = document.getElementById("finalMenu");

let couples = [];
let generateCouples = function () {
  // This function generates the positions, and the DOM elements for the couples
  // n is the number of images, that is, the number of couples
  let positions = [];
  for (let i = 0; i < 2 * N; i++) positions.push(i);

  shuffle(positions);
  //   console.log(options);

  for (let i = 0, nImg = 0; i < 2 * N; i += 2, nImg++) {
    let couple = {
      A: { pos: positions[i] },
      B: { pos: positions[i + 1] },
      img: images[nImg],
    };
    couples.push(couple);
  }
  for (let position = 0; position < N * 2; position++) {
    let nCouple = couples.findIndex(
      (c) => c.A.pos === position || c.B.pos === position
    );
    let couple = couples[nCouple];
    let AorB = couple.A.pos === position ? "A" : "B";
    let image = document.createElement("img");
    image.src = defaultImg;
    image.id = `image${nCouple}` + AorB;
    image.width = "100";
    image.height = "100";
    image.onclick = clickedImg;
    couple[AorB].imgDOM = image;
    container.appendChild(image);
  }
  //   console.log(couples);
};
let initialize = function () {
  for (let i = 0; i < N; i++) state.push({ A: "hidden", B: "hidden" });
  generateCouples(N);
  gameState = "on";
  //   console.log(couples);
};
let compare = function (
  s,
  p // function that compares two states // and returns a list with the positions where the differences are
) {
  let differences = [];
  for (let i = 0; i < N; i++) {
    // console.log("Comparing:", i, s[i].A, p[i].A);
    if (s[i].A != p[i].A) {
      //   console.log(i, "A diff");
      differences.push({ pos: i, elem: "A" });
    }
    if (s[i].B != p[i].B) {
      differences.push({ pos: i, elem: "B" });
    }
  }
  return differences;
};
let redraw = function () {
  // tomar cada imagen y dibujarla de acuerdo al estado
  let diffsPositions = compare(state, previousState);
  //   console.log(diffsPositions);
  for (diff of diffsPositions) {
    let newSrc;
    if (state[diff.pos][diff.elem] === "hidden") {
      newSrc = defaultImg;
    } else {
      newSrc = couples[diff.pos].img;
    }
    couples[diff.pos][diff.elem].imgDOM.src = newSrc;
  }
};
let startGame = function () {
  let nivel = parseInt(document.getElementById("nivel").value);
  console.log("Starting", nivel);
  if (nivel >= 1 && nivel <= 8) {
    // si el nivel es vlido
    N = nivel;

    initialize();
    // console.log(mainMenu);
    mainMenu.style.display = "none";
    container.style.display = "block";
  }
};

